    ?gene a up:Protein ;
          up:organism taxon:9606 ;
          up:catalyzes ?reaction .
  }
  SERVICE <https://sparql.rhea-db.org/sparql> {
    {
      ?reaction rhea:equation ?equation .
      ?equation rhea:has_input ?metaboliteURI .
    }
    UNION
    {
      ?reaction rhea:equation ?equation .
      ?equation rhea:has_output ?metaboliteURI .
    }
    ?metaboliteURI rdfs:label ?metabolite .
  }
}
